#include "inc.h"


class Solution {
public:
    bool isConvex(vector<vector<int>>& points) {
        int n = (int)points.size();
        bool hasAngle = false;
        long pre = 0;
        for(int i = 0; i < n; ++i){
            auto point1 = points[i % n];
            auto point2 = points[(i + 1) % n];
            auto point3 = points[(i + 2) % n];
            long val = (point2[0] - point1[0]) * (point3[1] - point1[1]) - (point2[1] - point1[1]) * (point3[0] - point1[0]);
            if(hasAngle == false){
                if(val != 0){
                    hasAngle = true;
                    pre = val;
                }
            }else{
                if(pre * val >= 0){
                    if(val != 0){
                        pre = val;
                    }
                }else{
                    return false;
                }
            }
        }
        return hasAngle;
    }
};


